export const data = {
    espanol: {
        function: {
            function_description: ["Esta función te ayudará a entender mejor el contenido de esta web. Cada vez que te encuentres confundido, presiona el icono", "que está en la barra navegadora, para recordarla. Que tengas un buen viaje!"]
        }

    },
    english: {
        function: {
            function_description: "this function can help you to understand deeper the content of this website. Each time you are confused, press the icon f( ) which is in the navigation bar, to refresh it. Have a nice trip!"
        }
    }

}
